function DisplayAnime({anime}) {
  const displayAnime = () => {
    return anime.map(data => {
      return (
        <div>
          <p>{data.anime}</p>
          <p>{data.character}</p>
          <p>{data.quote}</p>
        </div>
      )
    })
  }
  return <div>{displayAnime()}</div>
}

export default DisplayAnime
